import Producto1 from './prostarneosense.jpg'

function Producto () {
    return(
        <div className='producto'>
            <div>
                <p>Prostar Neosense </p>
            </div>
            <div>
                <img src = {Producto1} id='imagen' width={350}/>
            </div>
        </div>
    );
}

export default Producto;
